import React from "react";
import { useEffect, useState } from "react";
import useAuth from "../../hooks/useAuth";
import { Link } from "react-router-dom";
import axios from "axios";
import "./SearchPage.css"

const SearchPage = (props) => {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    const fetchVideos = async () => {
      try {
        let response = await axios.get(
          `https://www.googleapis.com/youtube/v3/search?q=${props.search}&key=AIzaSyB7JFFdYJah4J-bbQIscizH68BUw1QCoD4&part=snippet`
        );
        console.log(response.data.items);
        setVideos(response.data.items);
      } catch (er) {
        console.log(er);
      }
    };
    fetchVideos();
  }, [props.search]);
  
  return (
    <div className="grid-container">
      {videos.map((el) => {
        return (
          <Link to={`videos/${el.id.videoId}`}>
            <img className="col-6-med" style={{'padding': '1.5em', 'margin': '1em'}} src={el.snippet.thumbnails.default.url} width='250' height= '200'/>
            <div>{el.snippet.title}</div>
            <div>{el.snippet.description}</div>
          </Link>
        );
      })}
    </div>
  );
};

export default SearchPage;
